import React, {Component} from 'react';
import {StyleSheet, Text, View, FlatList, TouchableOpacity, Image} from 'react-native';
import AgeValidator from './components/AgeValidator'
import MyList from './components/MyList'

export default class App extends Component {
  constructor(props){
    super(props);

    this.state = {
      age: 0,
      text: "Ingresa tu edad",
      validator: false,
      lista:[
        {
          id: 1,
          name: 'Arequipa',
          img:'data:image/jpeg;base64,'
        },
        {
          id: 2,
          name: 'Puno',
          img:'data:image/jpeg;base64,'
        },
        {
          id: 3,
          name: 'Cuzco',
          img:'data:image/jpeg;base64,'
        },
      ]
    };
  }


  changeTextInput = text => {
    this.setState({age: parseInt(text)});
    if(parseInt(text)>=18){
      this.setState({text: "Es mayor de edad"})
    }else{
      this.setState({text: "Es menor de edad"})
    }
  };
  renderItem = ({item}) => (
    <TouchableOpacity>
      <View>
        <View>
        <Image
          style={styles.logo}
          source={{uri: item.img}}
        />
          </View>
        <Text>{item.name}</Text>
      </View>
    </TouchableOpacity>
  )

  render() {
    return (
      <View style={styles.container}>
        <Text>TAREA</Text>
        
        <View>
        
        <AgeValidator changeTextInput={this.changeTextInput}  age={this.state.age} text={this.state.text} validator={this.state.validator}/>
        </View>
        <View>
          
          
        </View>
        <MyList lista={this.state.lista} renderItem={this.renderItem} />
        <MyList lista={this.state.lista} renderItem={this.renderItem} />
      </View>

    );
  }
}
const styles = StyleSheet.create({
  container: {
    flex:1,
    justifyContent:'center',
    paddingHorizontal:10,
  },
  text: {
    alignItems:'center',
    padding: 10,
  },
  button: {
    top: 10,
    alignItems: 'center',
    backgroundColor: '#DDDDDD',
    padding: 10,
  },
  countContainer: {
    alignItems:'center',
    padding:10,
  },
  countText: {
    color:'#FF00FF',
  },
  logo: {
    width: 66,
    height: 58,
  },
});